contracts/Community.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import './Goal.sol';

contract Community {
  struct CommunityInfo {
    string name;
    string description;
    string startDate;
    string image;
    string brandingColor;
    string brandingLogo;
    uint256 subscriptionPrice;
    address payable owner;
    uint256 createdAt;
    bool deleted;
    uint256 membersCount;
  }

  CommunityInfo community;

  mapping(address => bool) public members;
  address[] private membersList;

  address[] goals;

  event Joined(address indexed member);
  event Left(address indexed member);
  event Deleted(address indexed owner);
  event GoalCreated(address goalAddress);

  modifier onlyOwner() {
    require(msg.sender == community.owner, 'Not the owner');
    _;
  }

  modifier isActive() {
    require(community.deleted == false, 'Community has been deleted');
    _;
  }

  modifier onlyMembers() {
    require(members[msg.sender], 'Not a member');
    _;
  }

  modifier isNotMember() {
    require(!members[msg.sender], 'Already a member');
    _;
  }

  modifier isMemberOrOwner() {
    require(msg.sender == community.owner || members[msg.sender] == true, 'Must be either the owner or a member');
    _;
  }

  constructor(string memory _name, string memory _description, string memory _startDate, string memory _image, string memory _brandingColor, string memory _brandingLogo, uint256 _subscriptionPrice, address payable _owner) {
    community = CommunityInfo({name: _name, description: _description, startDate: _startDate, image: _image, brandingColor: _brandingColor, brandingLogo: _brandingLogo, subscriptionPrice: _subscriptionPrice, owner: _owner, createdAt: block.timestamp, deleted: false, membersCount: 0});
    members[_owner] = true;
    membersList.push(_owner);
  }

  function join() public payable isActive isNotMember {
    require(msg.value >= community.subscriptionPrice, 'Insufficient subscription price');

    members[msg.sender] = true;
    membersList.push(msg.sender);
    community.membersCount += 1;

    emit Joined(msg.sender);
  }

  function leave() public isActive onlyMembers {
    members[msg.sender] = false;
    community.membersCount -= 1;
    _removeMemberFromList(msg.sender);
    emit Left(msg.sender);
  }

  function deleteCommunity() public isActive onlyOwner {
    emit Deleted(msg.sender);
    community.owner.transfer(address(this).balance);
    community.deleted = true;
  }

  function createGoal(string memory _name, string memory _description, string memory _image, uint256 _target, string memory _endDate) public isActive isMemberOrOwner {
    Goal goal = new Goal(_name, _description, _image, address(msg.sender), address(this), _target, _endDate);

    goals.push(address(goal));

    emit GoalCreated(address(goal));
  }

  function _removeMemberFromList(address _member) internal {
    uint256 length = membersList.length;
    for (uint256 i = 0; i < length; i++) {
      if (membersList[i] == _member) {
        membersList[i] = membersList[length - 1];
        membersList.pop();
        break;
      }
    }
  }

  function viewCommunity() public view returns (CommunityInfo memory) {
    return community;
  }

  function getGoals() public view returns (address[] memory) {
    return goals;
  }

  function isMember() public view returns (bool) {
    return members[msg.sender];
  }

  function getMembers() public view returns (address[] memory) {
    return membersList;
  }
}

contracts/Goal.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import './Idea.sol';
import './Community.sol';

struct GoalInfo {
  string name;
  string description;
  string image;
  string endDate;
  address owner;
  uint256 createdAt;
  uint256 target;
  uint256 reached;
  bool deleted;
}

contract Goal {
  GoalInfo public goal;

  address community;

  address[] ideas;

  event Deleted(address indexed owner);
  event IdeaCreated(address goalAddress);

  modifier onlyOwner() {
    require(msg.sender == goal.owner, 'Not the owner');
    _;
  }

  modifier isMemberOrOwner() {
    require(msg.sender == goal.owner || Community(community).members(msg.sender), 'Must be either the owner or a member');
    _;
  }

  modifier isActive() {
    require(goal.deleted == false, 'Goal has been deleted');
    _;
  }

  constructor(string memory _name, string memory _description, string memory _image, address _owner, address _community, uint256 _target, string memory _endDate) {
    goal = GoalInfo({name: _name, description: _description, image: _image, owner: _owner, createdAt: block.timestamp, deleted: false, target: _target, reached: 0, endDate: _endDate});

    community = _community;
  }

  function deleteGoal() public isActive onlyOwner {
    emit Deleted(msg.sender);
    goal.deleted = true;
  }

  function createIdea(string memory _name, string memory _description, string memory _image, uint256 _donationsTarget) public isActive isMemberOrOwner {
    Idea idea = new Idea(_name, _description, _image, _donationsTarget, address(msg.sender), payable(address(this)), community);

    ideas.push(address(idea));

    emit IdeaCreated(address(idea));
  }

  function viewGoal() public view returns (GoalInfo memory) {
    return goal;
  }

  function getIdeas() public view returns (address[] memory) {
    return ideas;
  }

  function getCommunity() public view returns (address) {
    return community;
  }
}

contracts/Idea.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import './Community.sol';
import './Goal.sol';

contract Idea {
  struct IdeaInfo {
    string name;
    string description;
    string image;
    address owner;
    uint donationsTarget;
    uint256 donationsReceived;
    uint256 createdAt;
    bool deleted;
    uint256 votesCount;
  }

  IdeaInfo idea;

  address payable goal;
  address community;

  mapping(address => bool) public votes;

  event Deleted(address indexed owner);
  event DonationReceived(address indexed donor, uint256 amount);
  event VotedIdea(address indexed voter);
  event UnvotedIdea(address indexed voter);

  modifier onlyOwner() {
    require(msg.sender == idea.owner, 'Not the owner');
    _;
  }

  modifier isActive() {
    require(idea.deleted == false, 'Idea has been deleted');
    _;
  }

  modifier onlyMember() {
    require(Community(community).members(msg.sender), 'Not a member of the community');
    _;
  }

  modifier hasVoted() {
    require(votes[msg.sender], 'User has not voted yet');
    _;
  }

  modifier hasNotVoted() {
    require(!votes[msg.sender], 'User has already voted');
    _;
  }

  constructor(string memory _name, string memory _description, string memory _image, uint256 _donationsTarget, address _owner, address payable _goal, address _community) {
    idea = IdeaInfo({name: _name, description: _description, image: _image, owner: _owner, donationsTarget: _donationsTarget, donationsReceived: 0, createdAt: block.timestamp, deleted: false, votesCount: 0});

    community = _community;
    goal = _goal;
  }

  function deleteIdea() public isActive onlyOwner {
    emit Deleted(msg.sender);
    idea.deleted = true;
  }

  function donate() public payable isActive {
    require(msg.value > 0, 'Donation must be greater than 0');

    idea.donationsReceived += msg.value;

    emit DonationReceived(msg.sender, msg.value);
  }

  function vote() public payable isActive onlyMember hasNotVoted {
    idea.votesCount += 1;
    votes[msg.sender] = true;

    emit VotedIdea(msg.sender);
  }

  function unVote() public payable isActive hasVoted {
    idea.votesCount -= 1;
    votes[msg.sender] = false;

    emit UnvotedIdea(msg.sender);
  }

  function viewIdea() public view returns (IdeaInfo memory) {
    return idea;
  }

  function getGoal() public view returns (address) {
    return goal;
  }

  function getCommunity() public view returns (address) {
    return community;
  }

  function isVoter() public view returns (bool) {
    return votes[msg.sender];
  }
}

